import Card from './Card';

 function Cards({characters}) {

   return (
      <div>
         {characters.map(({id,name,status,species,gender,origin,image}) => {
            return <Card 
                        name={name}
                        status={status}
                        species={species}
                        gender={gender}
                        origin={origin}
                        image={image} key={id} 
                        onClose={() => window.alert('Emulamos que se cierra la card')}/>
         })
         }
      </div>
   )
}

export default Cards;
